import React, { useState, useEffect } from "react";
import axios from "axios";
import "../Style/addTabStyle.css";
import Header from "../components/Navigation";

const AddSong = () => {
  const [title, setTitle] = useState("");
  const [artist, setArtist] = useState("");
  const [album, setAlbum] = useState("");
  const [chords, setChords] = useState("");
  const [lyrics, setLyrics] = useState("");
  const [favorite, setFavorite] = useState("");
  const [albumPicture, setAlbumPicture] = useState("");
  const [ytLink, setYtLink] = useState("");

  useEffect(() => {
    const fetchLoggedInUser = async () => {
      try {
        const token = localStorage.getItem("token");
        if (!token) {
          throw new Error("No token found");
        }

        const response = await axios.get(
          "http://localhost:8000/user/getLoggedInUser",
          {
            headers: {
              Authorization: token,
            },
          }
        );
        const loggedInUserID = response.data;
        setFavorite(loggedInUserID.toString());
      } catch (error) {
        console.log(error);
      }
    };

    fetchLoggedInUser();
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();

    // Create an object with the form data
    const songData = {
      title: title,
      artist: artist,
      album: album,
      chords: chords,
      lyrics: lyrics,
      favorite: favorite,
      albumPicture: albumPicture,
      ytLink: ytLink,
    };

    // Send a POST request to the backend
    axios
      .post("http://localhost:8000/song/songs", songData)
      .then((response) => {
        // Successfully saved the song on the backend
        console.log(response.data);

        // Reset the form
        setTitle("");
        setArtist("");
        setAlbum("");
        setChords("");
        setLyrics("");
        setFavorite("");
        setAlbumPicture("");
        setYtLink("");
      })
      .catch((error) => {
        // Error sending the request to the backend
        console.error(error);
      });
  };

  return (
    <div>
      <Header />
      <div className="add-song-container">
        <h1>Add Song</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="title">Title:</label>
            <input
              type="text"
              id="title"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="artist">Artist:</label>
            <input
              type="text"
              id="artist"
              value={artist}
              onChange={(e) => setArtist(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="album">Album:</label>
            <input
              type="text"
              id="album"
              value={album}
              onChange={(e) => setAlbum(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="chords">Chords:</label>
            <textarea
              id="chords"
              value={chords}
              onChange={(e) => setChords(e.target.value)}
              required
            ></textarea>
          </div>

          <div className="form-group">
            <label htmlFor="lyrics">Lyrics:</label>
            <textarea
              id="lyrics"
              value={lyrics}
              onChange={(e) => setLyrics(e.target.value)}
              required
            ></textarea>
          </div>
          <div className="form-group">
            <label htmlFor="albumPicture">Album Image Link:</label>
            <input
              type="text"
              id="albumPicture"
              value={albumPicture}
              onChange={(e) => setAlbumPicture(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="ytLink">YouTube Link:</label>
            <input
              type="text"
              id="ytLink"
              value={ytLink}
              onChange={(e) => setYtLink(e.target.value)}
              required
            />
          </div>

          <button type="submit">Add Song</button>
        </form>
      </div>
    </div>
  );
};

export default AddSong;
